import React, { Component } from 'react';

class GameInfoBlock extends Component {
    render() {
        return (
            <div className="game-info container">
                <h1>Game Name</h1>
                {/* <img>Game Image</img> */}
                <h3>Game Rating</h3>
                <p>Game Summary</p>
                {/* <img>Link Icon</img> */}
                <a>Link</a>
            </div>
        );
    }
}

export default GameInfoBlock;
